        "es": {
          "title": "⚽️ ATLÉTICO DE MADRID vs FC BARCELONA | EN DIRECTO #LaLiga Jornada 16",
          "description": "Dieciséis derrotas ha sufrido el #AtléticodeMadrid de Diego Simeone en sus 32 duelos contra el #FCBarcelona, alertado y presionado en su visita de este domingo al Metropolitano, donde cayó en sus dos últimas visitas, lo aguarda Antoine Griezmann -el futbolista diferencial rojiblanco- y pone a prueba el liderato sin su goleador, Robert Lewandowski, ni Jordi Alba. \n\n Insustancial en el Barcelona, que prescindió de él hace dos veranos, con 34 goles en 102 partidos, 'El Principito', protagonista de 147 tantos en 316 partidos como atlético, es el hombre más incontestable del actual equipo madrileño, transformado en un jugador total, por su fútbol, por su sacrificio, por su visión, por su lectura y por su determinación, con la que amenaza este domingo el orden de la clasificación de #LaLiga. \n\n También es la esperanza del Atlético. Por las cualidades del ' + Char(39) + '8' + Char(39) + ' pasa todo lo que pueda pensar en términos positivos este curso, como la obligación que tiene de defender sin descuido su lugar entre los cuatro primeros o la misión hoy aparentemente imposible de reengancharse a la competencia por el título, a once puntos de la cima del Barcelona. \n\n Es la última ocasión para creer en ello. También es una encrucijada para el Barcelona, entre la duda de su empate de la última jornada ante el Espanyol y entre la inquietud de la victoria por 3-4 contra el Intercity en la Copa del Rey, pero también entre la seguridad que describen sus números: líder las últimas cuatro citas, con 12 triunfos en las últimas 14 jornadas, con tan solo 6 goles en contra en 15 encuentros, con 34 goles a favor... \n\n Y sin Jordi Alba ni Robert Lewandowski. El delantero polaco vio esta semana cómo el Tribunal de Administrativo del Deporte (TAD) confirmaba los tres partidos de sanción que el Comité de Competición le puso tras la desconsideración que interpretó el árbitro Jesús Gil Manzano después de expulsarle ante el Osasuna. Así, Xavi tendrá que idear ante el Atlético una delantera sin el ‘pichichi’ de LaLiga, que tampoco podrá jugar ante el Getafe y el Girona. \n\n Los candidatos a suplir a Lewandowski en la punta del ataque son Ferran Torres, Memphis Depay y Ansu Fati. Y quien cuenta con más números de ser titular es éste último, autor del tanto de la clasificación el pasado miércoles en Alicante. En cambio, Ferran y Memphis dejaron una imagen gris en su oportunidad para reivindicarse ante el conjunto de Primera RFEF. \n\n Hasta ahora, la única vez que Lewandowski no salió de titular en Liga con el Barça fue el 10 de septiembre, cuando Xavi le dio descanso de inicio en el triunfo por 0-4 ante el Cádiz. Esa tarde el delantero centro fue Memphis Depay. \n\n En los 15 partidos de Liga que ha jugado, Lewandowski ha marcado 13 goles, una cifra que está muy por encima de las de sus compañeros en el ataque azulgrana. El segundo máximo goleador del Barcelona en la competición doméstica es Ousmane Dembélé con cuatro tantos. Le siguen Ansu Fati y Pedro González ‘Pedri’, con tres cada uno. \n\n Precisamente, el centrocampista canario vuelve a una convocatoria después de que Xavi le diera descanso en la eliminatoria de Copa del Rey. Además, otra vez el técnico azulgrana no tendrá a nadie en la enfermería y el central uruguayo Ronald Araujo ya demostró ante el Intercity que su estado físico es óptimo para ser titular. \n\n El Atlético ha ganado sólo una de las últimas cuatro jornadas, la más reciente ante el colista, el Elche, por 2-0, la semana pasada en el Metropolitano, en el plebiscito constante que se ha transformado ya el estadio rojiblanco en torno a la figura de Simeone, lejos de la firmeza de otros tiempos como local, fuera de la regularidad que lo dirigió a lo más alto. \n\n Y en medio del debate por Joao Félix. Su idea, expresada al club hace semanas, es irse en este mercado de invierno. Ya está abierto el plazo. No hay ofertas. Y el atacante portugués ha recuperado la titularidad que le fue ajena en diez de los doce partidos precedentes al Mundial de Qatar 2022, por el desencuentro con el técnico que ha rebajado su visibilidad. \n\n En una racha de tres goles en sus últimos tres partidos -uno en cada uno- o los cuatro tantos que ha aportado al Atlético en sus cinco duelos más recientes. Este domingo, repuesto de la sobrecarga en el gemelo que lo apartó de la visita a Oviedo en la Copa del Rey del pasado miércoles (0-2), apunta también a la titularidad. Nunca ha marcado gol al Barcelona. \n\n - Alineaciones probables: \n\n Atlético de Madrid: Oblak; Molina, Giménez, Savic, Reinildo; Llorente, Koke o Kondogbia, Barrios o Kondogbia, Carrasco; Griezmann y Joao Félix. \n\n Barcelona: Ter Stegen; Sergi Roberto, Araujo, Koundé, Balde; Frenkie de Jong, Pedri, Gavi; Dembélé, Ansu Fati y Raphinha. \n\n Árbitro: Munuera Montero. \n\n Estadio: Cívitas Metropolitano."
        }
      }
